(154, 271, 32, 34, 0, 'grrrrreat!'),
(155, 271, 35, 0, 0, 'Forgive me if I didn''t see it, but I would like, as a business, an area to create custom questions for my services and products. It would be nice to tailor fit them to my patient base. I do like, though, that there are pre-made questions so I don''t have to think about it so much. I think a preview section would be great. As a small business owner, my marketing and research budget is very small, so I like that I can send this query to just a few patients, in a very targeted way. \nAs a user, the set up is simple and easy to navigate. I did get a little confused on the &quot;new queries&quot; section. Maybe a small fix, like numbering them or putting a time stamp on them could help clear up any confusion on how many queries there are to answer. \nI have to tell you, it was very exciting to see an e-mail from ThoughtBase saying that they had sent me $5!!! As in actual money that I can take out and spend on some In-N-Out Burgers!!! or a triple nonfat extra whip latte!!! I have been a participant of several websites that pay you to take surveys, and none of them are as easy as ThoughtBase. Great job! '),
